function Card ( { transaction } ) {

    return (

        <div className='Card'>

            <div className='Description'>
                {transaction.description}
                {transaction.type}
            </div>

            <div className='Value'>
                {transaction.value}
                <button className='Btn-Excluir'> Excluir </button>
            </div>

        </div>

    )

}

export default Card
